function Dhikr() {
  return (
<div className= "mt-content">
<h4>حَسْبُنَا اللَّهُ وَنِعْمَ الْوَكِيلُ</h4>
<h1>হাসবুনাল্ল-হু ওয়া নি‘মাল ওয়াকীল</h1>

<p>আল্লাহই আমাদের জন্য যথেষ্ট, আর তিনি কতই না উত্তম কর্মবিধায়ক</p>
</div>

  );
}


export default Dhikr;
